import React from "react";

export default function Pages(countriesXPage, totalCountries, page) {
  const pageNumbers = [];
  const totalPages = Math.ceil(totalCountries / countriesXPage);

  for (let i = 1; i <= totalPages; i++) {
    pageNumbers.push(i);
  }

  return (
  <nav>
      <ul>
          {
              pageNumbers &&
              pageNumbers.map(pageNumber => {
                <li key={pageNumber}>
                    <a onClick={() => page(pageNumber)}>{pageNumber}</a>
                </li>
              })
          }
      </ul>
  </nav>
  );
}
